import React from "react";
import Tile from "./Tile.jsx";
import "../Styles/Board.css";

const Board = () => {
  let board = [
    [1, 2, 3, 4],
    [1, 2, 3, 5],
    [1, 2, 4, 5]
  ];


  return (
    <div className="board">
      {board.map((value) => (
        <Tile numTile={value} className="tiles"></Tile>
      ))}
      ;
    </div>
  );
};

export default Board;
